import styled from "styled-components";

const GridContainer = styled.div`
  background-color: #9fbb99;

`;

const GridItem = styled.img`
  width: 100%;
  /* Lägg till eventuella ytterligare stilar för grid-items (bilderna) */
`;


const GridItemLarge = styled(GridItem)`
  grid-column: span 2;
  /* Lägg till eventuella ytterligare stilar för större grid-items */
`;

const Grid = () => { 

  return (
    <GridContainer>
      <GridItem src="1.jpg" alt="Image 1" />
      <GridItem src="2.jpg" alt="Image 2" />
      <GridItem src="3.jpg" alt="Image 3" />
      <GridItemLarge src="4.jpg" alt="Image 4" />
      <GridItem src="image5.jpg" alt="Image 5" />
    </GridContainer>
  );
};
